function Home() {
  return (

    document.body.style.backgroundColor = "#282c34", 

    <div className="App">
      <header className="App-header">
        <h1>Tutorial pages</h1>    

        <ul>
          <li><a href={'./Bingo.js'}>Bingo</a> </li>
        </ul>  
        
           
      </header>
    </div>     

    

  );
}

export default Home;
